import { Host, h } from "@stencil/core";
/**
 * Creates and Area for an menu on the left site of the page and an content-area on the right site.
 *
 * A comprehensive example is available under "Seitennavigation" in the *Example Section*
 *
 * @name Site navigation base
 * @shortname Site navigation
 * @path /Scaffold
 *
 * @slot navigation - Navigationmenu lef-aligned.
 * @slot content - Content right-aligned,
 * @stable
 */
export class DsNavigatedContent {
  render() {
    return (h(Host, null, h("div", { class: "left" }, h("slot", { name: "navigation" })), h("div", { class: "right" }, h("slot", { name: "content" }))));
  }
  static get is() { return "ds-navigated-content"; }
  static get encapsulation() { return "shadow"; }
  static get originalStyleUrls() {
    return {
      "$": ["ds-navigated-content.scss"]
    };
  }
  static get styleUrls() {
    return {
      "$": ["ds-navigated-content.css"]
    };
  }
}
